import { Fragment } from "react";
import classes from'./NavBar.module.css'




const NavBar = () => {

const onClickHandler = () =>{
  console.log("clicked")
}


  return (
    <div className={classes.header}>
      <div>TO-DO APP</div>
      <div>
        <button onClick={onClickHandler}>ADD NEW TO-DO</button>
      </div>
    </div>
  );
};

export default NavBar;
